import Category from "../components/Common-components/Category";
import SpecialHeader from "../components/Common-components/SpecialHeader";
import ProductCard from "../components/ProductCard";
import { useEffect, useState } from "react";
import Skeleton from "../components/Skeleton/Skeleton";

function Iphones() {
  const [data, setData] = useState([]);
  const url = "http://localhost:8080/product";
  const [isLoading, setIsLoading] = useState(false);
  const [page, setPage] = useState(0);
  const [size, setSize] = useState(9);
  const [totalPages, setTotalPages] = useState(0);

  console.log(page);

  useEffect(() => {
            setIsLoading(true);
            fetch(url + "/all?page=" + page + "&size=" + size)
            .then((res) => {
              return res.json();
            })
            .then((array) => {
              setData(array);
              setIsLoading(false);
              setTotalPages(array.totalPages);
            });
          }, [page, size]
  );

  return (
    <>
      <SpecialHeader></SpecialHeader>
      <div className="mainPhoneContainer">
        <div className="phoneContainer">
          <div className="categoryIphones">
            <Category></Category>
          </div>
          <div className="iphoneSection">
            <div className="iphoneContainer">
              {isLoading ? [... new Array(6)].map((_, index) => <Skeleton></Skeleton>) : data.length != null ? data.map((obj) => <ProductCard key={obj.id} {...obj}></ProductCard>) : null}
            </div>
            <div className="pagination">
              {totalPages !== 0 ? [...new Array(totalPages)].map((obj, index) => <button onClick={() => setPage(index + 1)}>{index + 1}</button>) : null}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Iphones;
